INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES (0, "", 60006, 0, 605, 2, "", "今日の運勢は大吉！　ラッキーアイテムは「蛇の抜け殻」！\nこのアタシにお目にかかれるなんて……アンタ、幸せものね♪", 0, 0, 2, 2);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES (0, "", 60006, 0, 606, 3, "", "今日の運勢は中吉！　気になるあの人に会えちゃうかも！？\n『初夢を正夢にする枕』であなたに会え……な、なんでもない！", 0, 0, 2, 2);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES (0, "", 60006, 0, 607, 3, "", "今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！", 0, 0, 2, 2);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES (0, "", 60006, 0, 608, 3, "", "今日の運勢は中吉！　今日はおうちで、ゆーっくりくつろごう。\nお雑煮よし。みかんよし。さ、こたつで寝正月だ。君も入る？", 0, 0, 2, 1);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES (0, "", 60006, 0, 609, 4, "", "今日の運勢は小吉！　突然のドッキリに注意！\nおや、後ろに髪の長い女の霊が──フフ、冗談です。私ですよ。", 0, 0, 2, 2);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES (0, "", 60006, 0, 610, 4, "", "今日の運勢は小吉。慌てなくても、幸運はきっとやってくる。\n運は自分で掴むもの──媛が言ってました。でも、どうやって？", 0, 0, 2, 2);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES (190804, "カリン", 60006, 2, 611, 0, "", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 0, 3, 0);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES (190804, "カリン", 60006, 3, 612, 0, "", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 5, 3, 0);
